    "id": "2rqlKs",
    "name": "Beer Camp 013: Old Cantankerous",
    "nameDisplay": "Beer Camp 013: Old Cantankerous",
    "description": "Sierra Nevada Old Cantankerous (Stock Ale) is a collaboration beer brewed on 9/04/09 at Sierra Nevada’s R&D Pilot Brewery for Beer Camp #13. Beer Camps #13 & #14 consisted of the gold medal winning homebrewers from the 2009 American Homebrewers Association (AHA) National Homebrew Competition (NHC). Old Cantankerous was brewed with a combination of seven different domestic & continental malts including two types of Caramel, Chocolate, Pale, Pils, Munich & Vienna for a rich complexity with five different hops being used for balance & character including Magnum, Perle, Sterling & the New Zealand hops Pacifica & Southern Cross which were used in the hopback for additional aroma & complexity. The famous house ale yeast was used to top ferment & condition this American Strong Ale/Stock Ale for approx. 8-10 weeks. Like previous camp beers, Old Cantankerous is only available in select markets and at the brewery’s taproom & restaraunt until it’s history!",
