    "name": "Beer Camp: Dry-Hopped Barleywine-Style Ale",
    "nameDisplay": "Beer Camp: Dry-Hopped Barleywine-Style Ale (2017)",
    "description": "We're brewing a Dry-Hopped Barleywine Style Ale. Avery's founder, Adam Avery, was eager to brew this style and us this story: Sierra Nevada Bigfoot Barleywine inspired him to try his hand at the style, leading to the creation of Hog Heaven, an Avery brewing classic. The idea behind this beer for Beer Camp Across the World is actually not to \"collaborate\" at all, but, rather, to brew the exact recipe for Sierra Nevada's Bigfoot and the exact recipe of for Avery's Hog Heaven and blend the two distinct finished beers together, and then bottle condition a new version of these two classic beers. The resulting brew is lovingly dubbed \"Big Hog\" or \"HogFoot\" depending on the brewer's preference. It's big, intense, and hoppy. Great fresh or the perfect candidate for aging down the line.",
