        "id": "4nRKTH",
        "name": "DevESTATEtion",
        "nameDisplay": "DevESTATEtion",
        "description": "When the going gets bad, we make great beer.\r\n\r\nIt’s a shame when good barley goes bad. This spring, the combined effect of double digit sustained winds and concentrated rainfall created major stress on the normal course of our barley maturation — our crop went down for the count. Instead of crying in our beer—or lack thereof—we decided to do one better and make something new. Featuring organic malts and our estate-grown wet hops, this black IPA is the evil twin of our legendary Estate Ale. Black in color with a mild roasty flavor and moderate body, this beer has a bold citrusy and earthy hop flavor and aroma from the use of our own wet hops. We’d never let one bad harvest get in the way of a great beer, so join us in a toast to the memory of our devastating season.",
