                            "id": "AdHXWs",
                            "name": "Imperial Pils",
                            "nameDisplay": "Imperial Pils",
                            "description": "When ya think about it, calling any PILS an IMPERIAL PILS is somewhat ironic. At the time of its creation in the dim recesses of post-stone-age / pre-X-box European city states the PILSENER style was indeed the IMPERIAL beer of its time, putting every other more colorful beer of its time to shame amidst a revolution of thermometer making. And without a doubt; its reign was long. Now American-born ales have usurped all of the imperialness there is to usurp and for the PILS to rise again, like every aspiration-ridden social ladder-climb-ing creature on the planet it must furthur evolve... This is that! We have made our own not-so-ordinary PILS every week of every year since 1996 and we have come to respect its stature in our own brewery-world..but Darwin never sleeps. Evolution persists, the weak are meat and the strong will eat, and now this brew has happened... furthur, further, furthur...",
