    "nameDisplay": "Maillard's Odyssey - Beer Camp Across America (2014)",
    "description": "Rich, dark, and roasty. That was the concept Bell’s beer guru John Mallett aimed for and, true to John’s vision, Maillard’s Odyssey is exactly that. Its name honors the Maillard reaction—the “browning” of sugars and amino acids—that creates the wonderful caramelized toffee-like and roasted flavors so abundant in this beer.\r\n\r\nBell’s has done a lot to raise the Midwest’s craft beer bona fides. They are masters of many beer styles from their portfolio of top-notch American stouts all the way through to the alpha acid assault of their Hopslam Ale. Bell’s constantly reinvents beer styles and refines recipes with artful mastery and an oddball slant.",
