                "nameDisplay": "Sweetwater Dank Tank Big Ol' Belgian Blue Balls",
                "description": "There once was an old Belgian man who walked his donkey past a blueberry patch that was tended to by a beautiful maiden named Paige. Her blueberries were the juiciest in the land, which legend has it was due to her tending her patch in the nude. Every day as the old Belgian walked past the naked farmer with the fantastic berries, he was left with the most painful set of blue balls ever bestowed on a man.\nBrewed in the old man’s honor, we created a hefty 9% alc/vol Belgian wheat & rye concoction which features a squirt of the naked girl’s fresh organic blueberries from Serenbe Farms, giving Big Ol Belgian Blue Balls a slight taint of blueberry undertones to help him ease the pain. It’ll leave you lusting for more!",
