                "nameDisplay": "Tater Ridge - Beer Camp Across America (2014)",
                "description": "The Asheville area is a brewing hotspot nestled in the mountains of North Carolina. Tater Ridge was brewed by something of a craft beer super group made up of members of the Asheville Brewers Alliance. We’re fortunate to call these passionate and talented brewers our neighbors, and we hope this unique ale will be the first of many collaborations to come.\r\n\r\nWe’ve made plenty of new friends in the nearly 30-strong Asheville Brewers Alliance (ABA) since we started brewing in North Carolina. Two of whom—John Stuart of Green Man Brewery and Luke Dickinson of Wicked Weed Brewing—led this collaboration recipe and work tirelessly to bring creativity and a deep-seated love of locally made craft beer to the Appalachian Mountains.",
