                    "name": "There and Back - Beer Camp Across America",
                    "nameDisplay": "There and Back - Beer Camp Across America (2014)",
                    "description": "For beer folks, Chico, CA, and New Glarus, WI, are must-see capitals on the U.S. brewing map, but getting between the two is no simple feat. There and Back is named for the planes, trains, and zeal needed to connect them. This classic English-style Bitter is a complex yet easy-drinking mix of toasty malt and a fruity, herbal hop flavor.\r\n\r\nNew Glarus is fiercely loyal to its home state, growing to one of the largest breweries in the U.S. without selling a single drop outside of the borders of Wisconsin. With those local tastes in mind, New Glarus has perfected traditional German styles and invented masterful versions of complex and intense fruit beers featuring Wisconsin-grown ingredients.",
