                    "nameDisplay": "Trip In The Woods Barrel Aged Narwhal w/Red & Black Currents",
                    "description": "Barrel-Aged Narwhal is our deliciously dark Imperial Stout aged in Kentucky bourbon barrels. Barrel aging is a strange science; it mellows some characteristics of the original beer while intensifying others. Narwhal’s aggressive roastiness has calmed, but the rich, chocolate-like malt backbone is brought to the fore. Black as midnight, this intense stout is complex with notes of cocoa and espresso balanced with hints of vanilla and toasted coconut from the oak casks. Nearly as rare as it’s nautical namesake, try Barrel-Aged Narwhal while you can because like the creature itself, it will soon dive into the depths and leave nary a trace behind.\r\n\r\nAged in bourbon barrels with red and black currants added.",
